import styled from 'styled-components';

function Gist() {
	return (
	    <Wrapper>
		    {
		    	gists.map(function(gist, i){
		        	return <Gist data={gist} key={i} />
		    	})
		    }
	    </Wrapper>
	);
}

const Wrapper = styled.div`
  width: 50%;
  margin: auto;
  padding: 10px 0px;
`;

export default Gist
